INSERT [dbo].[OBJ_PRODUCT] ([ProductCode], [ProductDesc], [Descriptions], [ProductType], [ProductGroup], [UnitWeight], [UnitSell], [Supplier], [StatusCode], [UpdateDate], [UpdateBy], [IsDelete]) VALUES (N'PD0', N'Mì gà ngũ sắc dinh dưỡng đầy ấn tượng', N'Sợi mì dai ngon, sốt đậm đà chuẩn vị hòa quyện với thịt gà ngũ sắc dinh dưỡng tạo nên một kiệt tác ẩm thực đầy ấn tượng.',												0, 0, 0, 0, 0, 'I', CAST(N'2017-05-02 00:00:00.000' AS DateTime), 0, 0)
INSERT [dbo].[OBJ_PRODUCT] ([ProductCode], [ProductDesc], [Descriptions], [ProductType], [ProductGroup], [UnitWeight], [UnitSell], [Supplier], [StatusCode], [UpdateDate], [UpdateBy], [IsDelete]) VALUES (N'PC1', N'Mì gà quay độc đáo', N'Thịt gà thơm lừng được tẩm ướp vừa miệng kết hợp với những sợi mì giai ngon và chút rau xào khiến người ta ăn hoài không ngán',																0, 0, 0, 0, 0, 'I', CAST(N'2017-05-02 00:00:00.000' AS DateTime), 0, 0)
INSERT [dbo].[OBJ_PRODUCT] ([ProductCode], [ProductDesc], [Descriptions], [ProductType], [ProductGroup], [UnitWeight], [UnitSell], [Supplier], [StatusCode], [UpdateDate], [UpdateBy], [IsDelete]) VALUES (N'PC2', N'Cơm gà sốt cà chua', N'Hạt cơm mềm dẻo thơm lừng hương lúa gạo, thịt gà "tắm" trong nước sốt cà chua - chua chua ngọt ngọt vô cùng "tốn cơm".',																	0, 0, 0, 0, 0, 'I', CAST(N'2017-05-02 00:00:00.000' AS DateTime), 0, 0)
INSERT [dbo].[OBJ_PRODUCT] ([ProductCode], [ProductDesc], [Descriptions], [ProductType], [ProductGroup], [UnitWeight], [UnitSell], [Supplier], [StatusCode], [UpdateDate], [UpdateBy], [IsDelete]) VALUES (N'PC3', N'Cơm Chiên Hải Sản Rong Biển', N'Cơm Chiên Hải Sản ngon tuyệt cú mèo cho một bữa sáng, trưa, chiều, tối đủ chất đây. Bạn này là thành viên mới trong gia đình Sandwich của MINISTOP đó',							0, 0, 0, 0, 0, 'I', CAST(N'2017-05-02 00:00:00.000' AS DateTime), 0, 0)
INSERT [dbo].[OBJ_PRODUCT] ([ProductCode], [ProductDesc], [Descriptions], [ProductType], [ProductGroup], [UnitWeight], [UnitSell], [Supplier], [StatusCode], [UpdateDate], [UpdateBy], [IsDelete]) VALUES (N'PC4', N'Mực tẩm tiêu cay', N'Mê típ mắt với xiên mực tẩm tiêu cay của MINISTOP. Vỏ tẩm bột chiên vàng giòn rụm, hương mực nồng nàn lan tỏa khắp khứu giác. Chấm thêm chút tương ớt nữa thì ngon hết sảy',					0, 0, 0, 0, 0, 'I', CAST(N'2017-05-02 00:00:00.000' AS DateTime), 0, 0)
INSERT [dbo].[OBJ_PRODUCT] ([ProductCode], [ProductDesc], [Descriptions], [ProductType], [ProductGroup], [UnitWeight], [UnitSell], [Supplier], [StatusCode], [UpdateDate], [UpdateBy], [IsDelete]) VALUES (N'PC5', N'Gà xiên BBQ', N'Thịt gà được tẩm ướp gia vị đậm đà, nướng lên thơm lừng nức mũi sẽ là bữa ăn nhẹ siêu dinh dưỡng và ngon lành!',																					0, 0, 0, 0, 0, 'I', CAST(N'2017-05-02 00:00:00.000' AS DateTime), 0, 0)
INSERT [dbo].[OBJ_PRODUCT] ([ProductCode], [ProductDesc], [Descriptions], [ProductType], [ProductGroup], [UnitWeight], [UnitSell], [Supplier], [StatusCode], [UpdateDate], [UpdateBy], [IsDelete]) VALUES (N'PC6', N'Bò viên chiên siêu to khổng lồ', N'Bò viên luôn là món đồ chiên được nhiều tín đồ ăn vặt mê tít. Một xiên bò to chà bá, vị đậm đà, chiên nóng hổi, chấm với tương ớt hoặc tương cà thì còn gì tuyệt vời hơn',		0, 0, 0, 0, 0, 'I', CAST(N'2017-05-02 00:00:00.000' AS DateTime), 0, 0)
